  return (
    <BrowserRouter>
      <Wrapper>
        <h1>Covid Tracker</h1>
        <HomePage />
      </Wrapper>
    </BrowserRouter>
  );
}

export default App;

const Wrapper = styled.div`
  font-size: 16px;
  text-align: center;
